import { useEffect } from "react";

const AgentReports = () => {
  useEffect(() => {
    getAgentList();
  }, []);
  const getAgentList = async () => {
    try {
      const res = await GET_AGENTS_LIST_REPORT();
      console.log(res);
    } catch (err) {
      console.log(err);
    }
  };
  return <></>;
};
export default AgentReports;
